       {
						MessageBox.Show("No Description has been returned for the Finished Goods Number.........", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
						PageLeaveFunctions.SetNextInputPage(1);
						Args.Cancel = true;

       }
   }

   /* Comment Strings */


   /* Calculates Net Weight */

   decimal CompWeight1 = 0m;
   decimal CompWeight2 = 0m;
   decimal CompWeight3 = 0m;
   decimal CompWeight4 = 0m;
   decimal CompWeight5 = 0m;
   decimal CompWeight6 = 0m;
   decimal CompWeight7 = 0m;

   CompWeight1 = 0;
   CompWeight2 = 0;
   CompWeight3 = 0;
   CompWeight4 = 0;
   CompWeight5 = 0;
   CompWeight6 = 0;
   CompWeight7 = 0;

	decimal PartWeight = 0m;

	/* Inputs.var_part1.Value */
  if (Inputs.var_part1.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part1.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight1 = PartWeight * Inputs.dec_qty1.Value;
  }

	/* Inputs.var_part2.Value */
  if (Inputs.var_part2.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part2.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight2 = PartWeight * Inputs.dec_qty2.Value;
  }

	/* Inputs.var_part3.Value */
  if (Inputs.var_part3.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part3.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight3 = PartWeight * Inputs.dec_qty3.Value;
  }

	/* Inputs.var_part4.Value */
  if (Inputs.var_part4.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part4.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight4 = PartWeight * Inputs.dec_qty4.Value;
  }

	/* Inputs.var_part5.Value */
  if (Inputs.var_part5.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part5.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight5 = PartWeight * Inputs.dec_qty5.Value;
  }

	/* Inputs.var_part6.Value */
  if (Inputs.var_part6.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part6.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight6 = PartWeight * Inputs.dec_qty6.Value;
  }

	/* Inputs.var_part7.Value */
  if (Inputs.var_part7.Value != "")
  {
      available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_part7.Value, out PartWeight);

  }
  if (available_part) {
      CompWeight7 = PartWeight * Inputs.dec_qty7.Value;
  }

  /* Totals the individual component weights */
  Inputs.var_netweight.Value = CompWeight1 + CompWeight2 + CompWeight3 + CompWeight4 + CompWeight5 + CompWeight6 + CompWeight7;

  /* Used to display Netweight list incase verification is required */
  Inputs.var_weightlookup.Value = "1(" + CompWeight1.ToString() + ")" + " - 2(" + CompWeight2.ToString() + ")" + " - 3(" + CompWeight3.ToString() + ")" + " - 4(" + CompWeight4.ToString() + ")" + " - 5(" + CompWeight5.ToString() + ")" + " - 6(" + CompWeight6.ToString() + ")" + " - 7(" + CompWeight7.ToString() + ")";


  /* Returns Commodity Code from CSV */
  Inputs.var_commodity.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", "commodity_code", Inputs.var_fgnum.Value);


	 /* If no commodity code is returned from the CSV file it checks the parts master table */
	 string partclass = "";
	 partclass = "";
	 if (Inputs.var_commodity.Value == "")
	 {
			available_part = UDMethods.GetPartClass(Context.CompanyID, Inputs.var_fgnum.Value, out partclass);

	 }

	 /* As Part Class is used to assign Commodity Code */
	 string commodityID = "";
	 if ((Inputs.var_commodity.Value == "") && (partclass != ""))
	 {
			available_part = UDMethods.GetPartClassCommodity(Context.CompanyID, partclass, out commodityID);
			if( available_part)
				Inputs.var_commodity.Value = commodityID;
	 }

   /* Verifies Commodity code exists in IComCode Table within Epicor */
   string commoditycheck = "";
   commoditycheck = "";
   if (Inputs.var_commodity.Value != "")
   {
			bool result = UDMethods.GetICommImportCode(Context.CompanyID, Inputs.var_commodity.Value, out commoditycheck);
   }

   if (Inputs.var_commodity.Value != commoditycheck)
   {
			MessageBox.Show("The Configurator has assigned a Commodity code that does not have a corresponding Epicor record, please contact the Operations department to correct this error.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
			PageLeaveFunctions.SetNextInputPage(1);
			Args.Cancel = true;

   }

   if (Inputs.var_commodity.Value == "")
   {
			MessageBox.Show("The Configurator has been unable to determine the Commodity Code for the chosen configuration. Please contact the Operations department.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
			PageLeaveFunctions.SetNextInputPage(1);
			Args.Cancel = true;

   }
   else if (Inputs.var_commodity.Value != "")
   {
       PageLeaveFunctions.SetNextInputPage(4);
   }


   /* ********************************************************************************************************************************************************************************** */

   /* Pack Comment */

   string Mode = "";
   int CustID = 0;
   int OrderNum = 0;
   int QuoteNum = 0;
   string CustCountry = "";
   string CustName = "";
   string OTSID = "";
   bool OTS = false;
   int OTSCountry = 0;

		bool available_QuoteHed = false;
		bool available_OrderHed = false;
		bool available_Country = false;
		bool available_ShipTo = false;
		bool available_Customer = false;

	   /* Determines Current Configuration Mode and order/quote specifics */
	   Mode = Context.Entity;
	   CustID = 0; /* Set to Zero when not used for testing*/
	   CustCountry = "";
	   OrderNum = Context.OrderNumber;
	   QuoteNum = Context.QuoteNumber;

    /* ********************************************************************************************************************************************************************************** */
    if (Mode == "Quote")
    {
				/* Retrieve details from Quote Header */
        bool result = UDMethods.GetQuoteHed(Context.CompanyID, QuoteNum, out CustID, out OTSID, out OTS);

        if (result)
        {
					Inputs.var_custid.Value = CustID;
        }

				/* Retrieves customer name using customer ID */
				available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry);

        /* ************************************************************** */

        /* If a saved shipto address is specified gets country info */
        if (OTSID != "")
        {
            available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
            available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);
        }

        Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + QuoteNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
        Inputs.var_shipcountry.Value = CustCountry;
    }

    /* ********************************************************************************************************************************************************************************** */
    if (Mode == "Order")
    {

				/* Retrieve details from Order Header */
				available_OrderHed = UDMethods.GetOrderHed(Context.CompanyID, OrderNum, out CustID, out OTSID, out OTS);

        /* Retrieve details from Order Header */
        if (available_OrderHed) {
            Inputs.var_custid.Value = CustID;
        }


        /* Retrieves customer name using customer ID */
        available_Customer = UDMethods.GetCustomer(Context.CompanyID, CustID, out CustName, out CustCountry); 

        /* ************************************************************** */

        /* If a saved shipto address is specified gets country info */
        if (OTSID != "")
        {
            available_ShipTo = UDMethods.GetShipToCountryNum(Context.CompanyID, OTSID, out OTSCountry);
					  available_Country = UDMethods.GetCountryDescription(Context.CompanyID, OTSCountry, out CustCountry);
        }

        Inputs.var_orderdtl.Value = "Mode: " + Mode + "  |  Order/Quote No: " + OrderNum.ToString() + "   | Cust: " + CustName + "  |   ShipCountry: " + CustCountry;
        Inputs.var_shipcountry.Value = CustCountry;
    }

    /* ********************************************************************************************************************************************************************************** */
    if (Mode == "PcStatus")
    {

        Inputs.var_orderdtl.Value = "Mode: " + Mode;
        /* Inputs.var_shipcountry.Value = "Albania". */

        Inputs.var_custid.Value = 11131;

    }

    /* ********************************************************************************************************************************************************************************** */


	  string palletlookup = "";

	  palletlookup = "";

	  /* Finds Pallet lookup from csv based on Shipping country*/
	  palletlookup = PCLookUp.DataLookup("CountryPalletList", "pallet_type", Inputs.var_shipcountry.Value);

	  if (palletlookup != "")
	  {
	      Inputs.var_palletlookup.Value = palletlookup + "_Lookup";
	      Inputs.var_packcomment.Value = PCLookUp.DataLookup("CountryPalletList", "default_message", Inputs.var_shipcountry.Value);
	  }

	  if (palletlookup == "") { Inputs.var_palletlookup.Value = "All_Lookup"; }
}

 /* ********************************************************************************************************************************************************************************** */

/* Determine the frs operation cycle time based on FG Number */

/* Find frs cycle_time_selector */
string frscycletimelookup = "";
frscycletimelookup = "std";

/* Returns cycletime from Master FG List CSV */

string frscycletimeselector = "";

frscycletimeselector = frscycletimelookup + "_op_time_min";

Inputs.var_op10time.Value = System.Convert.ToDecimal(PCLookUp.DataLookup("TENUK_FG_MasterTable", frscycletimeselector, Inputs.var_fgnum.Value));
